import useForm from '../lib/useForm';

function CreateProduct() {
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          value={name}
          onChange={(e) => {
            console.log(e.target.value);
            setName(e.target.value);
          }}
          placeholder="Name"
        />
      </label>
      <label htmlFor="price">
        Price
        <input
          type="text"
          id="price"
          name="price"
          value={price}
          onChange={(e) => {
            console.log(e.target.value);
            setName(e.target.value);
          }}
          placeholder="Price"
        />
      </label>
    </form>
  );
}

export default CreateProduct;
